    "hoursUpdated": "\u03bf\u03b9 \u03ce\u03c1\u03b5\u03c2 \u03b5\u03bd\u03b7\u03bc\u03b5\u03c1\u03ce\u03b8\u03b7\u03ba\u03b1\u03bd", 
